    valid_predicates = {
        'has_upper': any(c.isupper() for c in generated_string),
        'has_lower': any(c.islower() for c in generated_string),
        'has_digit': any(c.isdigit() for c in generated_string),
        'has_punctuation': any(c in string.punctuation for c in generated_string),
        'is_alpha': generated_string.isalpha(),
        'is_alnum': generated_string.isalnum(),
        'is_ascii': all(ord(c) < 128 for c in generated_string)
    }
    result_dict = {p: valid_predicates[p] for p in predicates if p in valid_predicates}
    if not predicates:
        result_dict = {}
    if any(p not in valid_predicates for p in predicates):
        raise KeyError("Invalid predicate")
    return (generated_string, result_dict)
