import subprocess
import os
import signal
import time

def task_func(process_name: str) -> int:
    processes = []
    for pid in os.listdir('/proc'):
        try:
            pid_int = int(pid)
            with open(f'/proc/{pid_int}/cmdline', 'r') as f:
                cmdline = f.read().split('\x00')[0]
                if process_name in cmdline:
                    processes.append(pid_int)
        except (OSError, ValueError):
            continue
    if not processes:
        return 0
    for pid in processes:
        os.kill(pid, signal.SIGTERM)
    time.sleep(1)
    return len(processes)
