def rgb_to_hsv(r, g, b):
    r, g, b = r/255.0, g/255.0, b/255.0
    max_c = max(r, g, b)
    min_c = min(r, g, b)
    delta = max_c - min_c
    h = 0
    if delta != 0:
        if max_c == r:
            h = ( (g - b)/delta ) % 6
        elif max_c == g:
            h = ( (b - r)/delta ) + 2
        else:
            h = ( (r - g)/delta ) + 4
        h *= 60
    else:
        h = 0
    s = 0 if max_c == 0 else delta / max_c
    v = max_c
    return h, s, v

