import psutil
import time
import os

def task_func(script_path: str, timeout=10) -> dict:
    if not os.path.exists(script_path):
        return {'CPU Usage': 0, 'Memory Usage': 0}
    process = None
    try:
        process = subprocess.Popen(script_path, stdout=subprocess.PIPE, stderr=subprocess.PIPE, shell=True)
        start_time = time.time()
        cpu_usage = 0
        memory_usage = 0
        while process.poll() is None:
            if time.time() - start_time > timeout:
                process.terminate()
                break
            time.sleep(0.1)
            for proc in psutil.process_iter(['pid', 'cpu_percent', 'memory_rss']):
                if proc.info['pid'] == process.pid:
                    cpu_usage += proc.info['cpu_percent']
                    memory_usage += proc.info['memory_rss']
                    break
        if process.poll() is None:
            process.wait()
        return {'CPU Usage': cpu_usage, 'Memory Usage': memory_usage}
    except Exception as e:
        return {'CPU Usage': 0, 'Memory Usage': 0}
